import React from 'react';

const PopUpModal = ({ onClose }) => {
  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>&times;</span>
        <p>Please sign in to continue.</p>
      </div>
    </div>
  );
}

export default PopUpModal;
